import React from 'react';

const SearchBox = ({ onSearch }) => {
    return (
        <div className='wrap'>
            <div className='search'>
                <input id="searchbox" className='searchTerm' onKeyDown={onSearch} type="text" placeholder="pokemon name" />
                <button id="searchbtn" className='searchButton' onClick={onSearch} type="submit">
                    <i class="fa fa-search"></i>
                </button>
            </div>
        </div>

    )
}

export default SearchBox;
